#
# TABLE STRUCTURE FOR: Course
#

DROP TABLE IF EXISTS `Course`;

CREATE TABLE `Course` (
  `course_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `scheduled` datetime NOT NULL,
  `price` decimal(5,2) NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `instructor` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `capacity` int(11) NOT NULL,
  `citation_type_id` int(11) DEFAULT NULL,
  `school_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`course_id`),
  KEY `citation_type_id` (`citation_type_id`),
  KEY `school_id` (`school_id`),
  CONSTRAINT `Course_ibfk_1` FOREIGN KEY (`citation_type_id`) REFERENCES `Citation_Type` (`citation_type_id`),
  CONSTRAINT `Course_ibfk_2` FOREIGN KEY (`school_id`) REFERENCES `School` (`school_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



